protein = ''
def possiblernas(protein):
    codoncounts = {
        'M': 1, 'I': 3, 'T': 4, 'N': 2, 'K': 2, 'R': 6, 'S': 6, 'V': 4,
        'A': 4, 'D': 2, 'E': 2, 'G': 4, 'F': 2, 'L': 6, 'Y': 2, 'C': 2,
        'W': 1, 'P': 4, 'H': 2, 'Q': 2
    }
    rnastringcount = 1
    MOD = 1000000
    for amino_acid in protein:
        if amino_acid in codoncounts:
            rnastringcount = (rnastringcount * codoncounts[amino_acid]) % MOD
    return (rnastringcount * 3) % MOD  # Accounts for stop codon combinations

possiblernas(protein)
